    TResult Function(
            List<ShippingCompany> shippingCompanies,
            ShippingCompany? selectedShippingCompany,
            List<Vehicle> vehicles,
            Vehicle? selectedVehicle)?
        loaded,
    TResult Function()? success,
    required TResult orElse(),
  }) {
    if (success != null) {
      return success();
    }
    return orElse();
  }

  @override
  @optionalTypeArgs
  TResult map<TResult extends Object?>({
    required TResult Function(InitialDriverData value) initial,
    required TResult Function(ErrorDriverData value) error,
    required TResult Function(LoadingDriverData value) loading,
    required TResult Function(LoadedDriverDataState value) loaded,
    required TResult Function(SuccessDriverData value) success,
  }) {
    return success(this);
  }

  @override
  @optionalTypeArgs
  TResult? mapOrNull<TResult extends Object?>({
    TResult? Function(InitialDriverData value)? initial,
    TResult? Function(ErrorDriverData value)? error,
    TResult? Function(LoadingDriverData value)? loading,
    TResult? Function(LoadedDriverDataState value)? loaded,
    TResult? Function(SuccessDriverData value)? success,
  }) {
    return success?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(InitialDriverData value)? initial,
    TResult Function(ErrorDriverData value)? error,
    TResult Function(LoadingDriverData value)? loading,
    TResult Function(LoadedDriverDataState value)? loaded,
    TResult Function(SuccessDriverData value)? success,
    required TResult orElse(),
  }) {
    if (success != null) {
      return success(this);
    }
    return orElse();
  }
}

abstract class SuccessDriverData implements DriverDataState {
  factory SuccessDriverData() = _$SuccessDriverDataImpl;
}
